import React, { Component } from 'react';
class OutstandingClients extends Component {
    render() {
        let counter = 0
        this.props.clients.forEach(c => !c.sold ? counter += 1 :null )
        return (<div>Outstanding clients: {counter}</div>)
    }
}
export default OutstandingClients;
